import {Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Skills() {
  return (
    <div className="skills">
      <Container>
        <Row>
          <Col lg={3}>
            <i class="fa-brands fa-html5"></i>
            html
          </Col>
        </Row>
      </Container>
    </div>
  )
}
